import React, { Component } from 'react';

class Experience extends Component {
    render() {
        return (
            <div>
                <div className = "card">
                    <div className = "card-content">
                    <h5><b>KINH NGHIỆM</b></h5>
                        <div className = "row">
                            <p>         <b>Tháng 9/2019 - Tháng 9/2020:</b> Thực tập và tham gia hoàn thành 1 dự án website tại công ty VietMMO</p>
                        </div>
                        <div className = "row">
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Experience;
